// src/components/Banner1.js
import React from 'react';
import {BannerLeft} from './Banner'; // Import the generic Banner component

const Banner1 = () => (
  <BannerLeft
    logoSrc="../images/izzy-logo.png"
    overlayLogoSrc="../images/izzy-logo-overlay-2.png"
    bannerText="Hi, my name is Izzy. I study engineering 
    at Northestern. In my free time, I love playing music 
    and exploring natural wonders with my camera!"
  />
);

const Banner2 = () => (
    <BannerLeft
      logoSrc="../images/izzy-logo.png"
      overlayLogoSrc="../images/izzy-logo-overlay-2.png"
      bannerText="Hi, my name is Izzy. I study engineering 
      at Northestern. In my free time, I love playing music 
      and exploring natural wonders with my camera!"
    />
  );

export {Banner1, Banner2};
